import React, { Component } from 'react'
import { Avatar, Row, Col } from 'antd'

export default class Message extends Component {
    render() {
        return (
            <div>
                <div className="message-item message-left">
                    <Row>
                        <Col span={1}>
                            <Avatar shape="square" src="https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1582778785114&di=4bf0a9cbe00cd200465af9fe46b3091e&imgtype=0&src=http%3A%2F%2Fwww.56ec.org.cn%2Fd%2Ffile%2Fnews%2Frwgd%2F2017-05-15%2Fa26c40ec7d83c66d78ad6f791952a01b.jpg" />
                        </Col>
                        <Col span={23}>
                            <div className="message">
                                <span>这里是消息</span>
                            </div>
                        </Col>
                    </Row>
                </div>
            </div>
        );
    }
}
